window.bookSummaryJSON = "<p><b>Only Omega can free humanity.</b></p> <p>When the Ornu came, they took Earth in a single night. Humanity never stood a chance. Now, they force us to crew their ships and fight their wars for them. They hold Earth hostage, and if we refuse to do their bidding, they’ll lay waste to our precious blue marble. Slaughtering the billions who live there.</p> <p>But when Captain Bill Henderson is sent to claim a small moon for his masters, he finds something they never accounted for. An ancient warship – a behemoth abandoned for millennia by a species that reached its peak at the dawn of the universe.</p> <p><i>Could this ship of ages be exactly what humanity needs to cast off the shackles of their oppressors? Find out in Book 1 of Starship Omega, an engrossing new military sci fi saga from bestselling authors Scott Bartlett and Joshua James.</i></p>"; 
